description:
Director:Stuart St. Paul

Runtime: 1:26:32

Storyline
A Russian gang operating in Leeds with no respect for the laws of England,
 traffic Eastern Europeans in containers then enslave them,
 the women to sex, the men to illegal fights.
 They cross local businessman Gabe Taylor and a war escalates,
 but when his daughter is taken to be sold into the sex trade, Gabe fights back.

